import '../css/Hero.css';

class App extends Component {
  render(){
    return (
      <div className="App">
      <Hero/>

      </div>
    );
  }
}



function Hero() {
  return (
    <div className="Hero">
       <section class="hero">
        <header class="header">
            <h1>MEDINA MOHAMED</h1>
            <h2>Front-end Developer</h2>
        </header>
    </section>
    </div>
  );
}

export default Hero;
